import { Outlet, Link } from "react-router-dom";

const Layout = () => {
    return (
      <>
        <nav>
          <ul>

              <Link to="/">PageComponent</Link>


              <Link to="/ChooseGamemode">ChooseGamemode</Link>

          </ul>
        </nav>
  
        <Outlet />
      </>
    )
  };
  
  export default Layout;
